stream = ''

def shift_left(shf_list: list):
    shifted_list = [shf_list[i+1] for i in range(len(shf_list)-1)]
    return shifted_list
    
def is_unique(u_list: list):
    for j in range(len(u_list)):
        tmp_list = [item for item in u_list]
        tmp_list.remove(u_list[j])
        if u_list[j] in tmp_list: return False
    return True

